function onTouch(part) 
	math.randomseed(os.time())
	local humanoid = part.Parent:FindFirstChild("Humanoid") 
	if (humanoid ~= nil) then	-- if a humanoid exists, then
		--humanoid.Health = 0	-- damage the humanoid
		for i=1,14 do
		for j=1,28 do
		for k=1,28 do
			-- r = math.random(1,2) -- either 1 or 2
			r= math.random(1,20)
			if (r==1)then
				cijk=Instance.new("Part",workspace)
				cijk.Size = Vector3.new(3,3,3)
				cijk.Position = Vector3.new(50+4*j,4*i-4, 4*k)			
				cijk.BrickColor = BrickColor.new("Beige")
				cijk.Anchored = true	
				cijk.CastShadow = false		
			end 
		end
	end
end

